import React from 'react';
import './Tile.css';

interface Props {
    number: number,
    xcoord: number,
    ycoord: number
}

export default function Tile({number}: Props,{xcoord}: Props, {ycoord}) {
    if(number % 2 === 0) {
        return <div className='black-tile'>[{xcoord},{ycoord}]</div>;
    } else {
        return <div className='white-tile'>[{xcoord},{ycoord}]</div>;   
    }
}
